[[package]]
name = "arrow"
version = "1.2.1"
description = "Better dates & times for Python"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
python-dateutil = ">=2.7.0"

[[package]]
name = "asyncpg"
version = "0.25.0"
description = "An asyncio PostgreSQL driver"
